#coding:utf-8

"""
ID:          issue-4780
ISSUE:       https://github.com/FirebirdSQL/firebird/issues/4780
TITLE:       UNION sub-parts may be badly optimized. Check for ALL built-in functions.
DESCRIPTION:
    Derived table with UNION: sub-parts queries may be not optimized.
    Check result for every FB built-in function.
    No system tables are used in test queries.
    Rather, user-defined tables 'rdb_rels' and 'rdb_proc' are created with DDL and indices
    that correspond to rdb$relations and rdb$procedures (shown in the ticket).
    Test adds predictable data in these tables in order to exclude random change of plans
    because of index statistics.
    Number of inserted rows is big enough to exclude optimizer decision to use 'Full scan'
    because of tiny size of appropriate table.
NOTES:
    [25.07.2025] pzotov
    Test has been fully re-implemented.
    Separated expected output on major versions (5.x vs 6.x).
    Test probably will be further reimplemented, including adding checks for other functions.

    Issues exist for some functions when they are in WHERE-expresion: indices not used
    (e.g. blob_append for 5.x or any afggregate or windowed functions for 5.x and 6.x)
    Test duration: ~4...5 seconds.

    Discussed with dimitr, letters 30.06.2025, 14.09.2025.
    Checked on 6.0.0.1275; 5.0.4.1713.
"""
import datetime
import pytest
from firebird.qa import *

###################
ROWS_TO_ADD = 50000
###################

db = db_factory()

substitutions = \
    [ 
       ('record length(:)?\\s+\\d+, key length(:)?\\s+\\d+', 'record length: N, key length: M')
      ,('keys(:)?\\s+\\d+, total key length(:)?\\s+\\d+', 'keys: N, total key length: M')
      ,('match(:)?\\s+\\d+/\\d+', 'match: x/y')
      ,('bound(:)?\\s+\\d+/\\d+', 'bound: n/m')
      ,('record length(:)?\\s+\\d+', 'record length: L')
      ,('"PUBLIC".', '')
      ,('"', '')
    ]
act = python_act('db', substitutions = substitutions)

#-----------------------------------------------------------

def replace_leading(source, char="."):
    stripped = source.lstrip()
    return char * (len(source) - len(stripped)) + stripped

