    # rdb$relations:
    #     constraint rdb$index_0 unique (rdb$schema_name, rdb$relation_name);
    #     create index rdb$index_1 on rdb$relations (rdb$relation_id);
    # rdb$procedures:
    #     constraint rdb$index_21 unique (rdb$schema_name, rdb$package_name, rdb$procedure_name);
    #     constraint rdb$index_22 unique (rdb$procedure_id);

    init_script = f"""
        create sequence g;
        create domain dm_name varchar(64);
        create table dual(id int);
        create table rdb_rels(rel_id int not null, schema_name dm_name, rel_name dm_name);
        create table rdb_proc(prc_id int not null, schema_name dm_name, pkg_name dm_name, prc_name dm_name);

        insert into dual(id) values(1);
        set term ^;
        execute block as
            declare n int = {ROWS_TO_ADD};
            declare i int = 0;
        begin
            while (i < n) do
            begin
                insert into rdb_rels(rel_id, schema_name, rel_name) values(:i, 'SYSTEM', 'relation #' || :i);
                insert into rdb_proc(prc_id, schema_name, pkg_name, prc_name) values(:i, 'SYSTEM', 'package #' || mod(:i, 10), 'proc #' || :i);
                i = i + 1;
            end
        end
        ^
        set term ;^
        commit;
        alter table rdb_rels add constraint rdb_rels_pk primary key(rel_id);
        alter table rdb_proc add constraint rdb_proc_pk primary key(prc_id);
    """

    if act.is_version('<6'):
        init_script += """
            alter table rdb_rels add constraint rdb_rels_unq unique(rel_name);
            alter table rdb_proc add constraint rdb_proc_unq unique(pkg_name, prc_name);
            commit;
        """
    else:
        init_script += """
            alter table rdb_rels add constraint rdb_rels_unq unique(schema_name, rel_name);
            alter table rdb_proc add constraint rdb_proc_unq unique(schema_name, pkg_name, prc_name);
            commit;
        """

    act.isql(switches = ['-q'], input = init_script, combine_output = True)
    assert act.clean_stdout == '', f'Unexpected fail on init_script: {act.clean_stdout}'
    act.reset()


