    SQL_SCHEMA_SUFFIX = " and x.schema_name = 'SYSTEM'"
    RDB_SCHEMA_FIELD = 'schema_name'

    QRY_BODY = f"""
        select * from
        (
           select r.rel_id as id, {RDB_SCHEMA_FIELD} as schema_name, r.rel_name as name 
           from rdb_rels r
           UNION DISTINCT
           select p.prc_id, {RDB_SCHEMA_FIELD}, p.pkg_name
           from rdb_proc p
        ) as x where
    """

    DELIM_STR = '=' * 50
    
    with act.db.connect() as con:
        cur = con.cursor()
        ps = None
        for k,v in FUNC_MAP.items():
            test_sql = ''

            # get datatype of expression in the right part of WHERE:
            checked_expr = (v if 'dual' in v or 'NO_CHANGE' in v else f'select {v} from dual') + ' /* trace_me */'
            rs = cur.execute(checked_expr)
            
            # Each of these tuples contains information describing one result column:
            # (name, type_code, display_size, internal_size, precision, scale, null_ok)
            cur_cols = cur.description # cur_cols[0][1] -- <class 'int'>, <class 'str'> etc

            for op_kind in ('=', 'in', 'is not distinct from', '>|<', '>=|<=', 'between', 'starting with', 'like', 'similar to'):
                if op_kind in ('starting with', 'like', 'similar to'):
                    # print('check type of cur_cols::::', cur_cols[0][1])
                    if cur_cols[0][1] == str:
                        op_addi_pattern = ''
                        if v and op_kind in ('like', 'similar to'):
                            op_addi_pattern = " || '%'" # (need ?)
                        test_sql = QRY_BODY + f" name {op_kind} ({v}){op_addi_pattern} {SQL_SCHEMA_SUFFIX}"
                    else:
                        continue # numeric, date/time or boolean - can not be used with this op_kind
                else:
                    if cur_cols[0][1] in (int, float):
                        if '|' in op_kind:
                            op_part1, op_part2 = op_kind.split('|')[:2]
                            test_sql = QRY_BODY + f" id {op_part1} ({v}) and id {op_part2} ({v})"
                        elif op_kind == 'between':
                            test_sql = QRY_BODY + f" id between ({v}) and ({v})"
                        else:
                            test_sql = QRY_BODY + f" id {op_kind} ({v})"
                    elif cur_cols[0][1] in (str, bool, datetime.date, datetime.datetime, bytes):
                        if '|' in op_kind:
                            # column is compared with two values: "name > ... and name < ..." (and similar to ">=" and "<=")
                            op_part1, op_part2 = op_kind.split('|')[:2]
                            test_sql = QRY_BODY + f" name {op_part1} ({v}) and name {op_part2} ({v}) {SQL_SCHEMA_SUFFIX}"
                        elif op_kind == 'between':
                            test_sql = QRY_BODY + f" name between ({v}) and ({v}) {SQL_SCHEMA_SUFFIX}"
                        else:
                            test_sql = QRY_BODY + f" name {op_kind} ({v}) {SQL_SCHEMA_SUFFIX}"

                print(test_sql)
                if test_sql:
                    ps = cur.prepare(test_sql)
                    # Print explained plan with padding eash line by dots in order to see indentations:
                    print( '\n'.join([replace_leading(s) for s in ps.detailed_plan.split('\n')]) )
                    ps.free()
                    print(DELIM_STR)
            #< for op_kind in (...)
